import React from 'react'

function Card(props){
    return (
            <div class="xl:w-1/3 md:w-1/2 p-4">
                <div class="border border-gray-300 p-6 rounded-lg">
                    <h2 class="text-lg  font-medium title-font mb-2">{props.info.title}</h2>
                    <p class="leading-relaxed text-base">{props.info.description}</p>
                </div>
            </div>
    )
}

export default Card
